import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import Icono from "../asset/Icono.png";
import { ShoppingCart } from '@material-ui/icons';
import { Badge } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    marginBottom: "7rem",
  },
  appBar: {
    backgroundColor: "whitesmoke",
    boxShadow: "none",
  },
  grow: {
    flexGrow:1, //Permite ocuparle el máximo que pueda
  },
  button:{
    marginLeft: theme.spacing(2),
  }, 
  menuButton: {
    marginRight: theme.spacing(2),
  },
  image: {
      marginRight: "10px",
      width: "4rem"
  },
  title: {
    flexGrow: 1,
  },
}));

export default function Navbar() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <AppBar position="fixed" className={classes.appBar}>
        <Toolbar>
        <IconButton edge="start" className={classes.menuButton} color="inherit" aria-label="menu" on>
            <img src={Icono} alt="Logo" className={classes.image}/>
          </IconButton>
          <div className={classes.grow}/>
          <Typography variant="h6" color="textPrimary" component="p" >
            Via salud LTD.
          </Typography>
          <div className={classes.button}>
            <Button varian="outlined">
                <strong>Sign In</strong>
            </Button>
            <IconButton aria-label="Mostrar items carrito" color="inherit">
            <Badge badgeContent={2} color="secondary"> {/*Color a la compra*/}
            <ShoppingCart frontSize="large" color="primary"/>
            </Badge>
            </IconButton>
          </div>
        </Toolbar>
      </AppBar>
    </div>
  );
}
//Badge después se vuelve dinámico
